import React, { Component } from 'react'
import { AiOutlineShoppingCart } from 'react-icons/ai';

const HeaderCartButton =(props)=> {
     return (
      <button className="gap-4 inline-flex items-center bg-gray-100 border-0 py-1 px-3 focus:outline-none hover:bg-gray-200 rounded text-base mt-4 md:mt-0">
       
        <span><AiOutlineShoppingCart/></span>
        <span>Your Cart</span>
        <span>3</span>
      </button>
    ) 
};

export default HeaderCartButton
